in_str = ""
# in_str = "nppdvjthqldpwncqszvftbrmjlhg"
marker_len = 14
def main():
    marker = in_str[:marker_len]
    for i in range(marker_len, len(in_str)):
        marker = marker[1:] + in_str[i]
        dubs = [True for c in marker if marker.count(c) > 1]
        if not dubs:
            print(marker, i + 1)
            break

if __name__ == "__main__":
    main()